import {useState, useEffect} from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';

function Login(){
    return(
        <div className="Login">
            <div className="LoginArea">
                <div className="loginBox">
                    <div className="logoArea">
                        <div className="logoWrap"></div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export{Login}
